package protosrc

// 报错行号+3
const templateText = `// Generated by github.com/davyxu/tabtoy
// Version: {{.Version}}
// DO NOT EDIT!!
{{if ge .ProtoVersion 3}}
syntax = "proto3";
{{end}}

package {{.PackageName}};

{{range .ProtoImportFiles}}
import "{{.}}";
{{end}}
{{range $sn, $objName := $.Types.EnumNamesPlus $}}
enum {{$objName}}
{	
{{range $fi,$field := $.Types.AllFieldByName $objName}}
	{{$field.FieldName}} = {{$fi}}; // {{$field.Name}}
{{end}}
}
{{end}}
{{range $sn, $objName := $.Types.StructNamesPlus $}}
message {{$objName}}
{
{{range $fi,$field := $.Types.AllFieldByName $objName}}
	{{GoType $field}} {{$field.FieldName}} = {{ProtoStructIndex $fi}}; // {{$field.Name}}
{{end}}
}
{{end}}`
